INSERT INTO `bas_richtext` VALUES (0,'30579c09-8a47-4664-9509-5f8a85181ff3',NULL),(0,'37e9d792-3272-4033-8857-0945a256d5d0','<h2 class=\"page-header\" style=\"box-sizing: border-box; font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 1.1; color: rgb(134, 134, 136); margin: 40px 0px 20px; font-size: 30px; padding-bottom: 9px; border-bottom: 1px solid rgb(238, 238, 238); white-space: normal; background-color: rgb(250, 252, 255);\">Download</h2><p class=\"lead\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px; font-size: 21px; line-height: 1.4; color: rgb(134, 134, 136); font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; white-space: normal; background-color: rgb(250, 252, 255);\">There are a few ways to get started using Video.js (currently v<span class=\"vjs-version\" style=\"box-sizing: border-box;\">5.19.2</span>), but you should select the one that best fits your particular use case.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(134, 134, 136); font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(250, 252, 255);\">There are a few common things you should keep in mind regardless of which way you end up including Video.js in your project. The core codebase uses a few modern features of Javascript (ES5), so if you&#39;d like to support IE8 you&#39;ll need to include an ES5 shim. To make things easier, we created a single file you can include for IE8 support. No matter where the core Video.js library is placed, this file needs to be located in the&nbsp;<code style=\"box-sizing: border-box; font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 12.6px; padding: 2px 4px; color: rgb(199, 37, 78); background-color: rgb(249, 242, 244); border-radius: 4px;\">&lt;head&gt;</code>&nbsp;of the document.</p><h3 style=\"box-sizing: border-box; font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 1.1; color: rgb(134, 134, 136); margin-top: 20px; margin-bottom: 10px; font-size: 24px; white-space: normal; background-color: rgb(250, 252, 255);\">Video.js CDN</h3><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(134, 134, 136); font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(250, 252, 255);\">Our friends at&nbsp;<a href=\"http://fastly.com/\" target=\"_blank\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(102, 168, 204); text-decoration-line: none;\">Fastly</a>&nbsp;are nice enough to provide hosting for all the necessary files for Video.js on their content delivery network. Using these hosted files is probably the easiest way to get started using Video.js, you simply need to include the following links in your page.</p><pre style=\"box-sizing: border-box; overflow: auto; font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-top: 0px; margin-bottom: 10px; line-height: 1.42857; word-break: break-all; word-wrap: break-word; color: rgb(51, 51, 51); background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;\">&lt;head&gt;\r\n&nbsp;&nbsp;&lt;link&nbsp;href=&quot;http://vjs.zencdn.net/5.19.2/video-js.css&quot;&nbsp;rel=&quot;stylesheet&quot;&gt;\r\n\r\n&nbsp;&nbsp;&lt;!--&nbsp;If&nbsp;you&#39;d&nbsp;like&nbsp;to&nbsp;support&nbsp;IE8&nbsp;--&gt;\r\n&nbsp;&nbsp;&lt;script&nbsp;src=&quot;http://vjs.zencdn.net/ie8/1.1.2/videojs-ie8.min.js&quot;&gt;&lt;/script&gt;</pre><p><br/></p>'),(0,'7b16b2e8-19fb-11e7-a51f-f0def107233a',''),(0,'a63c7663-161e-11e7-a202-f0def107233a','<p>213123</p>'),(1,'2af4ba12-f07f-43c2-9941-6b0886163a1b','<p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">新媒体”这股颠覆性力量的崛起不仅影响着旧媒体的格局，也引领着媒体产业的潮流。2016年12月17日上午，2016中国新媒体千人峰会在广州召开，众多行业领军人物出席峰会，本次活动得到了雷士照明的大力支持。会议全天近1500人参会，数十位新媒体领袖、企业家和投资人进行发言。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　<strong style=\"border: 0px; margin: 0px; padding: 0px;\">行业领袖齐聚，共叙新媒体未来</strong></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　本次峰会以“拐点：新媒体运营与企业自媒体发展趋势”为主题，众多新媒体大咖、企业家、投资人共聚一堂，共同构筑新媒体千人峰会的话语平台，通过对当下和未来媒体话语体系的观瞻，见证时代拐点。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　会上，暨南大学新闻学院院长、南方日报报业集团前社长范以锦先生就“如何学会用特殊语境连接用户”进行了演讲，他认为这是一个万物皆媒体的时代，各类机构都在连接用户，媒体连接读者、听众、观众，宣传机构连接宣传对象，企业连接销售商、消费者，老师连接学生......无论在哪个平台，只要通过吸纳用户，有了市场占有率，就是内容创业，如果能够实现价值变现，内容创业就成功了。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　<img src=\"http://n1.itc.cn/img8/wb/recom/2016/12/20/148220810165521197.JPEG\"/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　著名独立财经观察家、秦朔朋友圈发起人秦朔先生就“新媒体的新挑战及其出路”为大家出谋划策，他认为新媒体时代的到来是媒体与社会的两重变化，新媒体的迅速发展并不是传统媒体的失败，而是传统媒体的骄傲和光荣。传统媒体人要积极转型，持续生产内容，打造内容供给链，改进沟通方式。同时，秦朔先生也对新媒体的社会责任发表了观点，他认为媒体走在经济的前沿，“自”媒体也要有“他”责任。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　<img src=\"http://n1.itc.cn/img8/wb/recom/2016/12/20/148220810361545405.JPEG\"/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　著名财经作家、吴晓波频道创始人吴晓波先生在视频中惊喜现身，他认为要将内容转化为产品，未来中国大众传播可能不复存在，为特定人群小众服务将越来越普及，大众传播将变成小众传播。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　<img src=\"http://n1.itc.cn/img8/wb/recom/2016/12/20/148220810182432126.JPEG\"/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　随后，汇志新媒体创始人、汇志股份董事长兼总裁翁宝先生就“新媒体集团化的运营和挑战”发表了自己的见解。翁宝先生认为，未来3-5年，中国肯定会出现一批新媒体集团。而新媒体集团化将遇到如何融合、 如何平台化两大问题。融合不仅仅是媒体形式的融合，更多是内容能力和服务能力的融合。同时就汇志新媒体的五年之路，讲述了如何实现新媒体平台化。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　<img src=\"http://n1.itc.cn/img8/wb/recom/2016/12/20/148220810166315366.JPEG\"/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　此外，广东文化产业投资管理有限公司总经理、广东文投创工场、广东文投国富董事长柳家平先生，广州广播电视台台长崔颂东先生，一条视频总编辑李晖女士，长隆集团市场总经理、资深媒体人熊晓杰先生，十点读书创始人林少先生，正和岛旗下远景科技CEO、正和岛前内容总监陈为先生，广东文投创工厂投资管理有限公司合伙人李希先生，广东省粤科母基金投资管理有限公司副总经理田政武先生，物道创始人彭永健先生，茶语网创始人张阳先生等众多嘉宾也分享了关于新媒体运营及发展趋势的见解。一条视频创始人徐沪生先生，雪球财经创始人方三文先生以及功夫财经创始人王牧笛先生也通过视频表达了自己的观点。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　<img src=\"http://n1.itc.cn/img8/wb/recom/2016/12/20/148220810160000394.JPEG\"/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　<img src=\"http://n1.itc.cn/img8/wb/recom/2016/12/20/148220810193509253.JPEG\"/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　<strong style=\"border: 0px; margin: 0px; padding: 0px;\">新媒体百人会正式成立</strong></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　中国新媒体千人峰会平台的构筑，旨在通过平台共振效应，推动不同行业之间从业者的互动交流，实现新媒体人、企业家和投资家的有效对接。在汇志新媒体创始人、汇志股份董事长兼总裁翁宝先生的推动下，新媒体百人会正式成立。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　新媒体百人会由各行业领军人物共同发起，峰会现场由秦朔、范以锦、柳家平、翁宝、林少、陈为六位代表完成启动仪式，集合了中国最优秀的新媒体成员，他们的公众号和平台在自身行业有着较大影响力，是中国新媒体千人峰会的嘉宾成员常设组织，是中国新媒体千人峰会的智库和嘉宾来源。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(51, 51, 51); word-wrap: break-word; font-family: 微软雅黑, 宋体; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　新媒体百人会秉承创建媒体新想象的理念，为后续每届千人峰会的举办提供不竭的思想动力；研究新媒体价值与运营新形态，关注新媒体迭代趋势和新新媒体成员成长；推动行业进步与发展，打造服务新媒体人的公益项目；新媒体百人会是新媒体人的智库，企业家的信息圈，投资家的项目池子。</p><p><br/></p>'),(1,'6d13f32b-6997-4272-bbb6-8b24b28851c9','<p style=\"font-family: 宋体; font-size: 14px; line-height: 20px; padding: 0px; text-align: center;\"><img src=\"http://cdn.huodongxing.com/file/20151116/11589C058E91B709BA26A427AFDD456708/30522664406291809.jpg\" title=\"3434343434.jpg\" alt=\"3434343434.jpg\"/></p><p><br/></p>'),(1,'c08a42f4-2f7e-4e24-933c-08953414d4ee',NULL),(1,'f34d66b3-985e-4498-b328-4bdaf5ae21eb','<p><img src=\"http://image.litecoder.com/html\\web\\richtext\\images\\20170424\\07ea3269-7e32-437d-b05e-d9526a19ae65.png\" title=\"\" alt=\"china.png\"/><br/></p><p><br/></p><p><a target=\"_blank\" href=\"http://www.baidu.com/link?url=zga7S5WLa9tWRcjYZSUkmRGR1b6QsSVACSHmv_iSfYS8YgByPXJDXQxphUsJp7aWOnJp9xNGI0IzAp7zvGYuZwUSNKKaVGJCaWzR9yz2MqTjjfxVX7_c_VHIi4FFyfZ4c-BQ9SGUR2PRbpyaXCAAqljb7eAXUDellac25p4_L5zs3qUvcNnOz7za_HiErUdOv4fNcc4o0T4jJmt3QEgu9ilo8kmB9u6L5UOgWNv8NfnLFSZOIJ27eO43wWjZXGdaQUiFdsTAYlOlBIRCwV5nFjcDJtIIfNxcUyuTvDoJ-cRJUr7w3lBDngC1MI9JV-38LCFcJm6W6N_PD3MLh8yYVX4trh0GjOoBfJi6UBEyf3NwjGIcVm_r2_xb1SFTsx0m1-l-ZEiKl4rXN-JOD2MdhQzTFolcKAQHT7n7u6zFNsTo50TQ2BDdqRp_yrWKZvexqf8WBIFgTGsShMszII6mftKD4vDIMFoLcFlNs7SikkONsmtThzC_stsngYq58rdOiiA0D_PO8wJKAzC5P5hG4BY_AOwaB1Y20SmmIvWRL-_zCzLtZonL_l0Mt2apCL9yjGq_X7xAlnntHXu8I7tJB_\" style=\"display: inline-block; position: relative; overflow: hidden; vertic