Xa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i1/2453188054/TB2.Z7JcY0kpuFjy0FjXXcBbVXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i3/2453188054/TB2wLoQdH4npuFjSZFmXXXl4FXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i3/2453188054/TB2OgwHc4XlpuFjSsphXXbJOXXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i1/2453188054/TB2JpAxdSVmpuFjSZFFXXcZApXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i2/2453188054/TB237sGdOlnpuFjSZFgXXbi7FXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i4/2453188054/TB2YQgOdHxmpuFjSZJiXXXauVXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i4/2453188054/TB2dlcUc80kpuFjSsppXXcGTXXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/></p>'),(2,'149e7fb8-8a3c-415c-bd5d-92fd5fb26f7d','<p><a href=\"http://12473.url.222bz.com/down/%E6%B3%A2%E6%96%AF%E7%8E%8B%E5%AD%90%EF%BC%9A%E6%97%B6%E4%B9%8B%E5%88%83@455_2.exe\" style=\"color: rgb(0, 136, 204); text-decoration-line: none; transition: 300ms;\"><img src=\"http://localhost:3000/html/web/richtext/catch/20170603/d33d60d7-f93f-451d-aa9e-55ef761eab2c.png\"/></a></p><p>剧情简介<br/>　　本片改编自著名的电玩游戏。古波斯王国骁勇善战的战士们征服了对手强国，一场惨烈的战争结束了，随军出征的波斯王子达斯坦（杰克·吉伦哈尔饰）在清点战利品的时候，发现了这把能够释放&quot;时之砂&quot;的匕首，他并不知道这把匕首拥有那么可怕的力量，达斯坦带着匕首和其他战利品回到了波斯，国王弟弟尼扎姆（本·金斯利饰）知道了匕首所拥有&quot;时之砂&quot;力量，他为了一己私欲，设计杀死了国王，并且嫁祸给了达斯坦，同时还释放了 &quot;时之砂&quot;……整个波斯王国的生灵惨遭涂炭，国民消失殆尽，取而代之的是嗜血的恶魔。亡命天涯的达斯坦背负了拯救波斯王国的使命，携手来历不明的神秘女郎塔米娜（杰玛·阿特登饰）公主，踏上了斩妖除魔的惊险旅途……<br/>&nbsp;远古的波斯是一个神秘的国度，那里有着许多未知的秘密等待人去揭开，谁掌握了打开秘密的锁匙，谁就能得到神奇而巨大的力量。在帝国某个偏僻而无人问津的地方，有着一把来自于上古时代的利刃匕首。这把匕首有着不可思议的力量，它能够释放出“时之砂”，“时之砂”可以让时间倒流，穿梭于过去的世界里，利用这种可怕的骇人力量，它能够让拥有它的人主宰整个世界的过去和未来，它可以拯救世界，亦可以毁灭世界……</p><p><br/></p>'),(2,'1a20d2d1-a7b9-4031-8dbc-ced46b53e16f','<p><img src=\"https://img.alicdn.com/imgextra/i2