ps://img.alicdn.com/imgextra/i3/2453188054/TB2sbLNeHsTMeJjy1zbXXchlVXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i2/2453188054/TB2mPHTeHsTMeJjSszhXXcGCFXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i3/2453188054/TB2vsTJeMMPMeJjy1XdXXasrXXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i1/2453188054/TB2xZTUeMoQMeJjy1XaXXcSsFXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i4/2453188054/TB2bIWvaGagSKJjy0FhXXcrbFXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i3/2453188054/TB2sIuvhFcJL1JjSZFOXXcWlXXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i3/2453188054/TB2m.SxaPuhSKJjSspmXXcQDpXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i4/2453188054/TB2DNWuaGagSKJjy0FbXXa.mVXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i3/2453188054/TB26BaEhRcHL1JjSZJiXXcKcpXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/></p>'),(2,'533b9137-b8f9-4c0f-b825-4499772ed055',NULL),(2,'6ae21c44-590f-49e4-902a-2b585c7cb2f3','<p><a href=\"https://sale.jd.com/act/YPhfZI2m4Mk3Aidr.html\" target=\"_blank\" style=\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); text-decoration-line: none; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255);\"></a></p><p>新开发的CMOS图像感应器有効像素约2420万</p><p>EOS 80D配备了佳能自主研发制造的新CMOS图像感应器，有效像素约2420万。</p><p><img alt=\"\" class=\"\" src=\"http://localhost:3000/html/web/richtext/catch/20170603/b7dd2418-3554-4733-b309-d8222086100d.png\"/></p><p>高性能自动对焦 — 全45点十字型自动对焦与进化的全像素双核CMOS AF</p><p>EOS 80D采用新开发的全45点十字型自动对焦感应器。中央1点采用对应F2.8光束的双十字结构，实现了高精度对焦。最大光圈为F8时，也有最多27个对焦点可用。</p><p><img alt=\"\" class=\"\" src=\"http://localhost:3000/html/web/richtext/catch/20170603/6652371b-910e-4462-9c2b-8541e9f25581.png\"/></p><p>得益于高像素，局部裁切亦可得到高精细画质</p><p>有效像素约2400万的图像以A3尺寸打印时，细节部分也不会模糊，可细致呈现。</p><p><img alt=\"\" class=\"\" src=\"http://localhost:3000/html/web/richtext/catch/20170603/340fdefb-f07f-4aaf-90de-e6200c9406cc.png\"/></p><p>DIGIC 6数字影像处理器带来高速处理</p><p>为高速处理庞大的数据，配备新开发的前端处理模组，前端处理模组与DIGIC 6数字影像处理器联动，可高效处理新CMOS图像感应器高速输出的图像信号。</p><p>约2420万有效像素下最高连拍速度达到约7张/秒</p><p>每秒可拍摄约7张，最多可连拍约110张的连拍性能是捕捉被摄体精彩瞬间的一大利器。</p><p><img alt=\"\" class=\"\" src=\"http://localhost:3000/html/web/richtext/catch/20170603/f5f7ce7d-054c-4894-aa79-724e755c8abe.png\"/></p><table width=\"750\" align=\"center\"><tbody><tr class=\"firstRow\"><td><img alt=\"\" class=\"\" src=\"http://localhost:3000/html/web/richtext/catch/20170603/ab3c367b-83b0-457e-9db9-2974dbe0f02f.png\"/></td><td><p class=\"formwork_titleleft\" style=\"line-height: 25px; font-size: 14px; font-weight: 700;\">视野率约100%的高性能光学取景器</p><p class=\"formwork_titleleft2\" style=\"line-height: 25px; font-size: 14px;\">视野率约为100%的光学取景器画面范围基本与实际拍摄范围相同，因此可以方便地在构图中令被摄体充满画面，有效减少画面周边意外拍入其他事物。</p></td></tr></tbody></table><p>继承EOS传统，机身设计值得信赖</p><p>在机身设计上EOS 80D秉承了EOS 70D的风格，机身外壳的连续转折面充满跃动感，整体设计刚柔并济。自动对焦点选择按钮下方的曲面更加平滑，手小的用户也可在握持手柄的状态下进行各项操作。</p><p><a href=\"https://sale.jd.com/act/YPhfZI2m4Mk3Aidr.html\" target=\"_blank\" style=\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); text-decoration-line: none; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255);\"></a><br/></p>'),(2,'70088d22-b4a3-11e7-b9b8-ab9c0b64d2f0','<p><img src=\"https://img.alicdn.com/imgextra/i4/2453188054/TB2qeRjp3oQMeJjy0FnXXb8gFXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img src=\"https://img.alicdn.com/imgextra/i2/2453188054/TB2Vo3EpHsTMeJjSsziXXcdwXXa_!!2453188054.jpg\" class=\"img-ks-lazyload\"/><img s