，以身体较瘦的人为主。其临床表现为当血淤滞于脏腑、经络某一局部时，则发为疼痛，痛有定处，得温而不减，甚至形成肿块。此类型的人，有些明明年纪未到就已出现老人斑，有些常有身上某部位疼痛的困扰，比如：女性生理期容易痛经，男性身上多有<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%B7%A4%E9%9D%92\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">淤青</a>，身上的<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%96%BC%E7%97%9B%E7%97%87\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">疼痛症</a>在夜晚加重等等。</p><ul class=\"basicInfo-block basicInfo-left list-paddingleft-2\" style=\"margin: 0px; padding: 0px; width: 395px; float: left;\"><li><p>中文名</p></li><li><p>血淤体质</p></li><li><p>主要征候</p></li><li><p>血行迟缓不畅</p></li><li><p>原&nbsp;&nbsp;&nbsp;&nbsp;因</p></li><li><p>情绪意志长期抑郁</p></li></ul><ul class=\"basicInfo-block basicInfo-right list-paddingleft-2\" style=\"margin: 0px; padding: 0px; width: 395px; float: left;\"><li><p>主要人群</p></li><li><p>身体较瘦的人</p></li><li><p>临床表现</p></li><li><p>疼痛，痛有定处，得温而不减</p></li><li><p>体质特点</p></li><li><p>头发容易脱落等</p></li></ul><h2 class=\"block-title\" style=\"margin: 22px 0px 0px 20px; padding: 0px; font-size: 18px; float: left; width: 63px; height: 48px; text-align: center; line-height: 48px; font-weight: 400;\">目录</h2><ol style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">1</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 120px;\"><a href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590?fr=aladdin#1\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">体质特点</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">2</span>&nbsp;<span class=\"text\" style=\"displ