s=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 120px;\"><a href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590?fr=aladdin#6\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">运动锻炼</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">7</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 120px;\"><a href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590?fr=aladdin#7\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">养生知识</a></span></p></li></ol><ol style=\"list-style-type: none;\" class=\" list-paddingleft-2\"></ol><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; font-weight: 400; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">体质特点</h2><p><a class=\"edit-icon j-edit-link\" style=\"color: rgb(136, 136, 136); display: block; float: right; height: 22px; line-height: 22px; padding-left: 24px; font-size: 12px; font-family: SimSun; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"font-family: baikeFont_layout; -webkit-font-smoothing: antialiased; speak: none; line-height: 1; outline: 0px; margin: 0px 3px 0px 0px; vertical-align: text-bottom; color: rgb(170, 170, 170);\"></span>编辑</a></p><p>◆头发容易脱落；</p><p>◆嘴唇颜色深，尤以唇缘为明显；</p><p>◆<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%88%8C%E8%B4%A8/3130380\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">舌质</a>青紫，或点点紫色，症状轻的人时有时无，重者常有，并且不褪不散；</p><p>◆眼眶暗黑，上下眼睑也呈紫黑色；</p><p>◆皮肤灰暗没有光泽，肤质粗糙，有皮屑，干燥，甚者如鱼鳞；</p><p><a class=\"image-link\" href=\"https://baike.baidu.com/pic/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590/0/29752a9bfacb1ca6c8eaf421?fr=lemma&ct=single\" target=\"_blank\" title=\"\" style=\"color: rgb(19, 110, 194); text-decoration-line: none; display: block; width: 173px; height: 220px;\"><img class=\"\" src=\"http://litecoder.oss-cn-shenzhen.aliyuncs.com/html\\web\\richtext\\catch\\20171107\\09d5a201-9c5f-447f-8203-4f976e2641b1.png\" alt=\"\"/></a></p><p>◆手指甲或脚指甲增厚变硬，稍轻的人指甲面高低不平，有条状或点状白色花纹；</p><p>◆头、胸、腹、背、腰、四肢等部位有固定的疼痛，时时发作；</p><p>◆常有胃脘部饱胀难消，按该部位，感觉不适；</p><p>◆妇女常有痛经、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%97%AD%E7%BB%8F/545691\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">闭经</a>现象。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; font-weight: 400; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">养生方法</h2><p><a class=\"edit-icon j-edit-link\" style=\"color: rgb(136, 136, 136); display: block; float: right; height: 22px; line-height: 22px; padding-left: 24px; font-size: 12px; font-family: SimSun; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"font-family: baikeFont_layout; -webkit-font-smoothing: antialiased; speak: none; line-height: 1; outline: 0px; margin: 0px 3px 0px 0px; vertical-align: text-bottom; color: rgb(170, 170, 170);\"></span>编辑</a></p><p>血淤体质者的病因与气血淤滞有关。气血一旦淤滞，既可能化寒，也可能化热，甚至痰淤相杂为患。养生根本之法在于<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%B4%BB%E8%A1%80%E5%8C%96%E6%B7%A4\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">活血化淤</a>。最好能注意调整自身气血，吃一些活血类型的食物或补药，多做有利于心脏血脉的运动，调整自身心理状态，保持身体和心理的健康。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; font-weight: 400; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">精神调养</h2><p><a class=\"edit-icon j-edit-link\" style=\"color: rgb(136, 136, 136); display: block; float: right; height: 22px; line-height: 22px; padding-left: 24px; font-size: 12px; font-family: SimSun; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"font-family: baikeFont_layout; -webkit-font-smoothing: antialiased; speak: none; line-height: 1; outline: 0px; margin: 0px 3px 0px 0px; vertical-align: text-bottom; color: rgb(170, 170, 170);\"></span>编辑</a></p><p>血淤体质之人在精神调养上，要注意培养乐观的情绪。精神愉快则气血和畅，血液流通，有利于血淤体质的改善。反之，此种体质者若陷入苦闷、忧郁情绪中则会加重<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4/3789497\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">血淤</a>倾向。保持心情的舒适顺畅对血淤体质者的身体益处十分重要。</p><p><br/></p>'),(3,'17b5bf16-9d77-4270-8f6c-9409450c930f','<ul class=\"lemmaWgt-lemmaTitle lemmaWgt-lemmaTitle- list-paddingleft-2\" style=\"margin: 0px 0px 10px; padding: 0px; width: 700px;\"><li><h1 style=\"margin: 0px 10px 0px 0px; padding: 0px; font-size: 38px; height: 55px; line-height: 1.15; font-weight: 400; display: inline; vertical-align: sub;\">气郁体质</h1><p>&nbsp;<a class=\"lock-lemma\" target=\"_blank\" href=\"https://baike.baidu.com/view/10812319.htm\" title=\"锁定\" style=\"color: rgb(160, 160, 160); text-decoration-line: none; display: inline; outline: 0px; margin: 0px 5px 0px 0px; height: 12px; font-size: 12px; position: relative; top: -2px;\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_lock-lemma\" style=\"-webkit-font-smoothing: antialiased; speak: none; line-height: 12px; outline: 0px; font-family: baikeFont_layout; margin: 0px 5px 0px 0px; height: 12px; vertical-align: text-top;\"></span>锁定</a></p></li></ul><p>气郁体质（Qi depression constitution）是由于长期情志不畅、气机郁滞而形成的以性格内向不稳定、忧郁脆弱、敏感多疑为主要表现的体质状态。处于这种体质状态者，多见于中青年，以女性多见，性格多孤僻内向，易多愁善感，气量较狭小。气郁体质者的发病以肝为主，兼及心、胃、大肠、小肠。易伤情志及饮食，易产生气机不畅，如郁病、失眠、梅核气、惊恐等，现代研究此类体质易生肿瘤。调理治疗宜调畅情志，疏通气机。</p><ul class=\" list-paddingleft-2\" style=\"margin: 0px; padding: 0px 20px 0px 0px; border-bottom: 1px dashed rgb(229, 229, 229);\"><li><p>就诊科室</p></li><li><p>中医内科</p></li></ul><ul class=\"bottomLine list-paddingleft-2\" style=\"margin: 0px; padding: 0px 20px 0px 0px; border: 0px; min-height: 34px; line-height: 34px;\"><li><p>多发群体</p></li><li><p>各类人群</p></li></ul><ul class=\" list-paddingleft-2\" style=\"margin: 0px; padding: 0px 20px 0px 0px; border-bottom: 1px dashed rgb(229, 229, 229);\"><li><p>常见病因</p></li><li><p>先天遗传、经常熬夜、精神刺激等</p></li></ul><ul class=\"bottomLine list-paddingleft-2\" style=\"margin: 0px; padding: 0px 20px 0px 0px; border: 0px; min-height: 34px; line-height: 34px;\"><li><p>常见症状</p></li><li><p>多愁善感，气量较狭小</p></li></ul><p><img class=\"brandImg\" src=\"https://gss0.bdstatic.com/94o3dSag_xI4khGkpoWK1HF6hhy/baike/q%3D90/sign=e38abe4ef11986184747e3844bedbedd/b3119313b07eca8035a902c8982397dda1448374.jpg\" alt=\"\"/></p><h2 style=\"margin: 0px; padding: 0px 0px 6px; font-size: 20px; color: rgb(51, 51, 51); line-height: 21px;\">科普中国</h2><p class=\"con_text\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(127, 141, 155); line-height: 18px; font-size: 14px;\">致力于权威的科学传播</p><h3 style=\"margin: 0px 0px -4px; padding: 0px; font-size: 14px; color: rgb(51, 51, 51); font-weight: 100;\">本词条内容贡献者为：</h3><p><img width=\"53\" src=\"https://gss0.bdstatic.com/94o3dSag_xI4khGkpoWK1HF6hhy/baike/w%3D53/sign=37d3a1abc33d70cf4cfaaa0efadc6bc3/86d6277f9e2f070860d5d992e324b899a801f254.jpg\" alt=\"贡献者头像\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(144, 145, 146); line-height: 20px;\"><span class=\"con_docName\" style=\"color: rgb(71, 72, 73);\">黄峰</span>丨主任医师</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(144, 145, 146); line-height: 20px;\"><span class=\"margin_r_4\" style=\"margin-right: 4px;\">陕西中医药大学附属医院&nbsp;&nbsp; 中医内科</span>&nbsp;<span class=\"docReview bk-editable-edit\" style=\"display: inline-block; padding: 0px 4px; line-height: 14px; height: 14px; border: 1px solid rgb(219, 219, 219); border-radius: 2px; background: rgb(255, 255, 255); color: rgb(136, 136, 136);\">审核</span></p><p>国家卫生计生委<br/>权威医学科普传播网络平台</p><p><a href=\"http://www.baikemy.com/zhaomu/index\" target=\"_blank\" class=\"cover\" style=\"color: rgb(255, 255, 255); text-decoration-line: none; position: absolute; background: rgb(88, 160, 236); top: 0px; left: 0px; width: 236px; height: 56px; display: block; visibility: hidden; line-height: 51px; transform: translate(0px, -100%); transition: all 0.3s;\"><span style=\"font-size: 20px;\"></span></a></p><h2 class=\"block-title\" style=\"margin: 22px 0px 0px 20px; padding: 0px; font-size: 18px; float: left; width: 63px; height: 48px; text-align: center; line-height: 48px; font-weight: 400;\">目录</h2><ol style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">1</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 180px;\"><a href=\"https://baike.baidu.com/item/%E6%B0%94%E9%83%81%E4%BD%93%E8%B4%A8/4272825?fr=aladdin#1\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">病因及常见疾病</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">2</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 180px;\"><a href=\"https://baike.baidu.com/item/%E6%B0%94%E9%83%81%E4%BD%93%E8%B4%A8/4272825?fr=aladdin#2\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">检查</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">3</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 180px;\"><a href=\"https://baike.baidu.com/item/%E6%B0%94%E9%83%81%E4%BD%93%E8%B4%A8/4272825?fr=aladdin#3\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">鉴别诊断</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">4</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 180px;\"><a href=\"https://baike.baidu.com/item/%E6%B0%94%E9%83%81%E4%BD%93%E8%B4%A8/4272825?fr=aladdin#4\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">治疗原则</a></span></p></li></ol><h2 class=\"headline-1 custom-title \" style=\"margin: 35px 0px 15px -30px; padding: 0px; font-size: 22px; color: rgb(51, 51, 51); border-left: 12px solid rgb(79, 156, 238); font-family: &quot;Microsoft Yahei&quot;, SimHei, Verdana; font-weight: 500; line-height: 22px; clear: both; zoom: 1; background-image: url(&quot;https://bkssl.bdimg.com/static/wiki-lemma/widget/lemma_content/mainContent/customTitle/img/title-line_c5e6d61.png&quot;); background-position: initial; background-size: initial; background-repeat: repeat-x; background-attachment: initial; background-origin: initial; background-clip: initial; overflow: hidden; position: relative; white-space: normal;\"><span class=\"headline-content\" style=\"line-height: 1; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 0px 8px 0px 18px;\">基本信息</span></h2><ul class=\"basicInfo-block basicInfo-left list-paddingleft-2\" style=\"margin: 0px; padding: 0px; width: 395px; float: left;\"><li><p>就诊科室</p></li><li><p>中医内科</p></li><li><p>多发群体</p></li><li><p>各类人群</p></li></ul><ul class=\"basicInfo-block basicInfo-right list-paddingleft-2\" style=\"margin: 0px; padding: 0px; width: 395px; float: left;\"><li><p>常见病因</p></li><li><p>先天遗传、经常熬夜、精神刺激等</p></li><li><p>常见症状</p></li><li><p>多愁善感，气量较狭小</p></li></ul><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; font-weight: 400; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">病因及常见疾病</h2><p>1.先天遗传。</p><p>2.经常熬夜。</p><p>3.发病以肝为主，兼及心、胃、大肠、小肠。易伤情志及饮食，易产生气机不畅。长期压力过大，思虑过度。</p><p>4.突发的精神刺激，如亲入去世、暴受惊恐等。</p><p>5.常见疾病：消化性溃疡、神经官能症、失眠、躁郁症、更年期综合征、郁病、失眠、梅核气、惊恐等。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; font-weight: 400; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">检查</h2><p>面色苍暗或萎黄，性情急躁易怒，易于激动，或忧郁寡欢，胸闷不舒，时欲太息，舌淡，舌边红，苔白，脉弦。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; font-weight: 400; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">鉴别诊断</h2><p><span style=\"font-weight: 700;\">1.气虚体质</span></p><p>表现为气不足，常常四肢乏力，不耐运动，容易疲劳，感冒。</p><p><span style=\"font-weight: 700;\">2.阳虚体质</span></p><p>怕冷不耐寒。</p><p><span style=\"font-weight: 700;\">3.阴虚体质</span></p><p>怕热，老是口渴口干，表现为有很多内热。</p><p><span style=\"font-weight: 700;\">4.湿热体质</span></p><p>形体偏胖多有痤疮粉刺、常感口干口苦、身重困倦。</p><p><span style=\"font-weight: 700;\">5.痰湿体质</span></p><p>形体肥胖、颜面多油、嗜好肥甘。</p><p><span style=\"font-weight: 700;\">6.瘀血体质</span></p><p>脸上有钞票纹，身上容易长斑，舌下静脉容易瘀紫发暗。</p><p><span style=\"font-weight: 700;\">7.特禀体质</span></p><p>容易过敏，起荨麻疹等等的过敏性体质。</p><p><span style=\"font-weight: 700;\">8.气郁体质</span></p><p>容易郁闷的，抑郁。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><p><br/></p>'),(3,'38ea4612-8b71-4215-ae8c-99b5ff3655a0','<p><span style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; background-color: rgb(255, 255, 255);\">阴虚</span><span style=\"color: rgb(204, 0, 0); font-family: arial; font-size: 13px; background-color: rgb(255, 255, 255);\">体质</span></p>'),(3,'902fb458-f488-44e3-913c-c3cedfdc0542','<p>阳虚体质</p>'),(3,'aa2c4286-10c6-424e-b6d7-99960d5ea371',NULL),(3,'b5f699a4-22b2-42f4-8923-db56090908d6',NULL),(3,'b8c26cfe-2fc9-40d4-99d3-248219fafefb',NULL),(3,'deb172ff-4fb4-469f-a2eb-9a09362ba17f','<ul class=\"lemmaWgt-lemmaTitle lemmaWgt-lemmaTitle- list-paddingleft-2\" style=\"margin: 0px 0px 10px; padding: 0px; width: 700px; font-family: arial, tahoma, &quot;Microsoft Yahei&quot;, 宋体, sans-serif; color: rgb(51, 51, 51); font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><li><h1 style=\"margin: 0px 10px 0px 0px; padding: 0px; font-size: 34px; display: inline; line-height: 1.15; font-weight: 400; vertical-align: sub;\">血淤体质</h1><p>&nbsp;<a class=\"edit-lemma cmn-btn-hover-blue cmn-btn-28 j-edit-link\" style=\"color: rgb(102, 102, 102); display: inline-block; border: 1px solid rgb(197, 197, 197); border-radius: 3px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-align: center; line-height: 14px; padding: 6px 0px; position: relative; margin: 0px 5px 0px 0px; width: 60px; outline: 0px; height: 14px; top: -2px;\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"font-family: baikeFont_layout; -webkit-font-smoothing: antialiased; speak: none; line-height: 12px; outline: 0px; margin: 0px 7px 0px 0px; vertical-align: text-top; color: rgb(82, 163, 245);\"></span>编辑</a></p></li></ul><p>血淤体质的主要征候是血行迟缓不畅，多半是因为情绪意志长期抑郁，或久居寒冷地区，以及<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%84%8F%E8%85%91/1110357\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">脏腑</a>功能失调所造成，以身体较瘦的人为主。其临床表现为当血淤滞于脏腑、经络某一局部时，则发为疼痛，痛有定处，得温而不减，甚至形成肿块。此类型的人，有些明明年纪未到就已出现老人斑，有些常有身上某部位疼痛的困扰，比如：女性生理期容易痛经，男性身上多有<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%B7%A4%E9%9D%92\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">淤青</a>，身上的<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%96%BC%E7%97%9B%E7%97%87\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">疼痛症</a>在夜晚加重等等。</p><ul class=\"basicInfo-block basicInfo-left list-paddingleft-2\" style=\"margin: 0px; padding: 0px; width: 395px; float: left;\"><li><p>中文名</p></li><li><p>血淤体质</p></li><li><p>主要征候</p></li><li><p>血行迟缓不畅</p></li><li><p>原&nbsp;&nbsp;&nbsp;&nbsp;因</p></li><li><p>情绪意志长期抑郁</p></li></ul><ul class=\"basicInfo-block basicInfo-right list-paddingleft-2\" style=\"margin: 0px; padding: 0px; width: 395px; float: left;\"><li><p>主要人群</p></li><li><p>身体较瘦的人</p></li><li><p>临床表现</p></li><li><p>疼痛，痛有定处，得温而不减</p></li><li><p>体质特点</p></li><li><p>头发容易脱落等</p></li></ul><h2 class=\"block-title\" style=\"margin: 22px 0px 0px 20px; padding: 0px; font-size: 18px; float: left; width: 63px; height: 48px; text-align: center; line-height: 48px; font-weight: 400;\">目录</h2><ol style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">1</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 120px;\"><a href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590?fr=aladdin#1\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">体质特点</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">2</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 120px;\"><a href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590?fr=aladdin#2\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">养生方法</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">3</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 120px;\"><a href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590?fr=aladdin#3\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">精神调养</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">4</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 120px;\"><a href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590?fr=aladdin#4\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">饮食调养</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">5</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 120px;\"><a href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590?fr=aladdin#5\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">药物养生</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">6</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 120px;\"><a href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590?fr=aladdin#6\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">运动锻炼</a></span></p></li><li><p><span class=\"index\" style=\"display: inline-block; width: 18px; font-size: 16px; padding-left: 20px; padding-right: 8px; vertical-align: top; text-align: right; color: rgb(99, 160, 223);\">7</span>&nbsp;<span class=\"text\" style=\"display: inline-block; font-size: 16px; vertical-align: top; width: 120px;\"><a href=\"https://baike.baidu.com/item/%E8%A1%80%E6%B7%A4%E4%BD%93%E8%B4%A8/10818590?fr=aladdin#7\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">养生知识</a></span></p></li></ol><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; font-weight: 400; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">体质特点</h2><p><a class=\"edit-icon j-edit-link\" style=\"color: rgb(136, 136, 136); display: block; float: right; height: 22px; line-height: 22px; padding-left: 24px; font-size: 12px; font-family: SimSun; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"font-family: baikeFont_layout; -webkit-font-smoothing: antialiased; speak: none; line-height: 1; outline: 0px; margin: 0px 3px 0px 0px; vertical-align: text-bottom; color: rgb(170, 170, 170);\"></span>编辑</a></p><p>◆头发容易脱落；</p><p>◆嘴唇颜色深，尤以唇缘为明显；</p><p>◆<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%88%8C%E8%B4%A8/3130380\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">舌质</a>青紫，或点点紫色，症状轻的人时有时无，重者常有，并且不褪不散；</p><p>◆眼眶暗黑，上下眼睑也呈紫黑色；</p><p><br/></p>');
