DROP TABLE IF EXISTS `crm_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `crm_user` (
  `user_id` char(36) NOT NULL COMMENT '用户ID（主键）',
  `parent_id` char(36) DEFAULT NULL COMMENT '引导用户',
  `wx_unionid` char(36) NOT NULL COMMENT '微信唯一用户id',
  `user_mobile` varchar(64) DEFAULT NULL COMMENT '绑定手机',
  `user_name` varchar(64) DEFAULT NULL COMMENT '用户名',
  `user_logo` varchar(255) DEFAULT NULL COMMENT '头像',
  `user_sex` tinyint(4) NOT NULL DEFAULT '1' COMMENT '性别\n            0：女\n            1：男',
  `user_city` varchar(10) DEFAULT NULL COMMENT '城市',
  `user_birthday` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '用户生日',
  `user_credit` int(11) NOT NULL DEFAULT '0' COMMENT '积分',
  `user_member_level` tinyint(4) DEFAULT '0' COMMENT '会员等级\n            0:非会员(尚未在平台上有购买记录）\n            1：普通会员（有购买记录的）\n            2：尊享会员（有购买尊享会员记录的）\n            3：家庭会员（有购买家庭会员记录的）',
  `user_memo` varchar(2000) DEFAULT NULL COMMENT '备注',
  `rec_create_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '用户入驻日期',
  `ext_field1` varchar(255) DEFAULT NULL COMMENT '扩展字段1',
  `ext_field2` varchar(255) DEFAULT NULL COMMENT '扩展字段2',
  `ext_field3` varchar(255) DEFAULT NULL COMMENT '扩展字段3',
  `user_body` char(36) DEFAULT NULL,
  `user_balance` decimal(11,2) DEFAULT NULL COMMENT '用户余额',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `unionidIndex` (`wx_unionid`),
  KEY `parentIndex` (`parent_id`),
  CONSTRAINT `FK_Reference_23` FOREIGN KEY (`parent_id`) REFERENCES `crm_user` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

