--
-- Table structure for table `ui_tab_items`
--

DROP TABLE IF EXISTS `ui_tab_items`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ui_tab_items` (
  `item_id` char(36) NOT NULL COMMENT '内容id',
  `tab_id` char(36) NOT NULL COMMENT '标签id',
  `item_index` int(11) NOT NULL DEFAULT '1' COMMENT '位置索引',
  `item_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '子项类型\n            0:广告推广位(Slider)\n            1:产品分类展示\n            2:分隔图\n            3:纯html\n            ',
  `item_product_template` varchar(64) DEFAULT NULL COMMENT '产品显示模板（type=1)\n            ',
  `item_product_catalog` char(36) DEFAULT NULL COMMENT '绑定的产品类型id（type=1)',
  `item_product_display` int(11) DEFAULT '0' COMMENT '显示产品类目下的产品数量（type=1)\n            0:全部显示\n            其他数字：select top',
  `item_image` varchar(255) DEFAULT NULL COMMENT '分割图路径',
  `item_image_click` tinyint(4) DEFAULT '0' COMMENT '分割图点击相应方式\n            0:无操作\n            1:打开链接\n            2:切换标签',
  `item_image_param` varchar(255) DEFAULT NULL COMMENT '分割图点击参数',
  `item_html` varchar(2000) DEFAULT NULL COMMENT '子项内容(type=3)',
  `item_visible` tinyint(4) NOT NULL DEFAULT '1' COMMENT '显示子项\n            0:不显示\n            1:显示',
  `rec_create_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '记录创建时间',
  `ext_field1` varchar(255) DEFAULT NULL COMMENT '扩展字段1',
  `ext_field2` varchar(255) DEFAULT NULL COMMENT '扩展字段2',
  `ext_field3` varchar(255) DEFAULT NULL COMMENT '扩展字段3',
  `rec_isdeleted` tinyint(4) NOT NULL DEFAULT '0' COMMENT '记录删除状态',
  `item_name` varchar(64) DEFAULT NULL,
  `item_video` varchar(255) DEFAULT NULL COMMENT '视频文件地址',
  PRIMARY KEY (`item_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

