CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_Login`(username varchar(20),pwd varchar(128),out result int)
label_pro:BEGIN
	
	DECLARE userid char(36);
    DECLARE userPassword varchar(128);
    
    
    SET result = 0;
    select user_id,user_password into userid,userPassword
	from fw_users 
    where user_account=username
		
		and rec_isdeleted=0;
    
    IF userid is NULL THEN 
		SET result = 1;
        SELECT result;
		LEAVE label_pro;
	END if;
    
	IF userPassword!=pwd THEN
		SET result = 2;
        SELECT result;
		LEAVE label_pro;
    END if;
		
	
	select user_id,dept_id,user_name,user_photo,user_mobile
	from fw_users where user_id=userid;
    
    call proc_GetSystemFunctions4User(userid,0);
    
    call proc_GetSecurityForUser(userid);
    
    SELECT result;
END ;;
