CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_member_info`(
	userid char(36),
	parentid char(36),
	wxunionid char(36),
	usermobile varchar(64),
	username varchar(64),
	logo varchar(255),
	sex TINYINT,
	city varchar(10),
	birthday datetime,
	credit int,
	member_level TINYINT,
	memo varchar(2000)
	
)
BEGIN
  #Routine body goes here...
	declare has_user int;
    if not exists(select 1 from crm_user where wx_unionid=wxunionid) then
		insert into crm_user(
			user_id,parent_id,wx_unionid,user_mobile,user_name,user_logo,user_sex,user_city,
			user_birthday,user_credit,user_member_level,user_memo,rec_create_date
		)
		values(
			userid,parentid,wxunionid,usermobile,username,logo,sex,city,
			birthday,credit,member_level,memo,NOW()
		);	
	else 
		update crm_user set 
