	select  
		user_id,
        parent_id,
        wx_unionid,
        user_mobile,
        username,
        user_name,
        user_logo,
        user_sex,
        user_city,
		user_birthday,
        user_credit,
        user_member_level
		from crm_user 
        where wx_unionid=wxunionid;
END ;;
