CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_UI_layoutArchitecture`()
BEGIN
/*
    declare pricefield varchar(30);
    if memberlevel=0 then  set pricefield = `sku_price`; end if;
    if memberlevel=1 then  set pricefield = `sku_std_member_price`; end if;
    if memberlevel=2 then  set pricefield = `sku_vip_member_price`; end if;
    if memberlevel=3 then  set pricefield = `sku_home_member_price`; end if;
    */
	#tab
	select tab_id as id,null as pid,tab_title as title,tab_content_type as type,
	'' as image,tab_url as param,tab_index as orderindex,
		1 as level,
        '' as ext1,
        '' as ext2,
        '' as ext3,
        '' as ext4,
        '' as ext5,
        '' as ext6
	from ui_tablayout                
	where tab_visible=1 and rec_isdeleted=0

	union
	#tab_item
	select item_id as id,tab_id as pid,'' as title,item_type as type,
					item_image as image,
				   (case item_type when 0 then '' 
								  when 1 then item_product_template
								  when 2 then item_image_param
								  when 3 then item_html  
                                  when 4 then item_video end) as param,  
					item_index as orderindex,2 as level,
                    item_image_click as ext1,
                    '' as ext2,
                    '' as ext3,
                    '' as ext4,
                    '' as ext5,
                    '' as ext6
	from ui_tab_items 
	where item_visible=1 and rec_isdeleted=0

	 
	union 
    #slider
	select slider_id as id,item_id as pid,'' as title,slider_click as type,
				slider_image as image,
				slider_click_param as param,slider_index as orderindex,3 as level,
				'' as ext1,'' as ext2,
                '' as ext3,
                '' as ext4,
				'' as ext5,
				'' as ext6
				from ui_tabitem_slider
	where slider_visible=1
	 
	union 
    #product
	select rec_id as id,item_id as pid,pd.product_name as title,0 as type,
				ifnull(uipd.show_image,pd.product_image) as image, uipd.product_id as param,
				product_index as orderindex,4 as level,
				pd.product_describ as ext1,
				if(pd.product_spec=0,ifnull(skusingle.sku_price,0), skuitem.lowprice) as ext2,
                if(pd.product_spec=0,ifnull(skusingle.sku_price,0), skuitem.highprice) as ext3,
                if(pd.product_spec=0,ifnull(skusingle.sku_discount_price,ifnull(skusingle.sku_price,0)), skuitem.lowdprice) as ext4,
                if(pd.product_spec=0,ifnull(skusingle.sku_discount_price,ifnull(skusingle.sku_price,0)), skuitem.highdprice) as ext5,
                (case when gbview.group_id is null then 0
                else 1-gbview.expired end) as ext6
				from ui_tabitem_products uipd
	inner join ec_products pd on uipd.product_id = pd.product_id
	inner join ec_product_sku skusingle on skusingle.product_id=pd.product_id and skusingle.product_id=skusingle.spec_key 
	left join (select product_id,
				min(ifnull(sku_price,0)) as lowprice,max(sku_price) as highprice,
                min(ifnull(sku_discount_price,ifnull(sku_price,0))) as lowdprice,
                max(ifnull(sku_discount_price,ifnull(sku_price,0))) as highdprice
                from
				ec_product_sku sku where rec_isdeleted=0
                and sku.product_id!=sku.spec_key
                group by product_id) skuitem
				on pd.product_id = skuitem.product_id
	left join vw_ec_groupbuyresult gbview on uipd.product_id=gbview.product_id
	where product_visible=1 and pd.rec_isdeleted=0
	 order by pid,level,orderindex;
 
 
END ;;
DELIMITER ;
