CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_UI_moveProduct`(
recid int,
direction tinyint,   -- 0:  向上    1：向下移动
out result int	
)
BEGIN
	declare parentid char(36);
	declare nextRecordIndex int;
    declare nextId int;
    declare currentIndex int;
    
    
    select item_id, product_index into parentid,currentIndex from ui_tabitem_products where rec_id=recid;
    
    SET result = 0;
	-- 向上移动
	if direction = 0 then
		-- 找到上一条记录
        select rec_id,product_index into nextId,nextRecordIndex from ui_tabitem_products
        where product_index < currentIndex and item_id=parentid order by product_index desc limit 1;
    else -- 向下移动
		-- 找到下一条记录
        select rec_id,product_index into nextId,nextRecordIndex from ui_tabitem_products
        where product_index > currentIndex order by product_index limit 1;
    end if;
    
    -- 修改自己和待移动的字段位置
    if nextId is not null then
		update ui_tabitem_products set product_index=nextRecordIndex where rec_id=recid;
        update ui_tabitem_products set product_index=currentIndex where rec_id=nextId;
        SET result = 1;
    end if;
    SELECT result;
END ;;
DELIMITER ;
