CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_UI_moveSlider`(
sliderid int,
direction tinyint,   -- 0:  向上    1：向下移动
out result int	
)
BEGIN
	declare parentid char(36);
	declare nextRecordIndex int;
    declare nextId int;
    declare currentIndex int;
    
    
    select item_id, slider_index into parentid,currentIndex from ui_tabitem_slider where slider_id=sliderid;
    
    SET result = 0;
	-- 向上移动
	if direction = 0 then
		-- 找到上一条记录
        select slider_id,slider_index into nextId,nextRecordIndex from ui_tabitem_slider
        where slider_index < currentIndex and item_id=parentid order by slider_index desc limit 1;
    else -- 向下移动
		-- 找到下一条记录
        select slider_id,slider_index into nextId,nextRecordIndex from ui_tabitem_slider
        where slider_index > currentIndex order by slider_index limit 1;
    end if;
    
    -- 修改自己和待移动的字段位置
    if nextId is not null then
		update ui_tabitem_slider set slider_index=nextRecordIndex where slider_id=sliderid;
        update ui_tabitem_slider set slider_index=currentIndex where slider_id=nextId;
        SET result = 1;
    end if;
    SELECT result;
END ;;
